function App() {
//-----------get request from api Content House-----------------------
    let request = new Request('http://content-house.pro/cs/api/export/categories/70037?login=lego&password=e7ddaob3&format=json')
        fetch(request, {mode: 'no-cors'})
        .then(response => {return response.json})
        .then( prom => {console.log(JSON.toString(prom))})
        .catch(error => {
            console.log("Fetch error :",error)
        });
//------------------------------------------------------------------------

  return (
      <div id="wrapper" className="container">

          <Header/>
